import axios from "axios";
import React, { useEffect, useState } from "react";
import "./Home.css";

const Home = () => {
  const Url = "https://restcountries.com/v2/all?fields=name,region,flag";

  const [data, setdata] = useState(null);
  const fetchdata = () => {
    try {
      axios.get(Url).then((res) => {
        setdata(res.data);
      });
    } catch (error) {
      console.log("ERROR");
    }
  };

  useEffect(() => {
    fetchdata();
  });

  console.log(data);

  return (

      <div>
        {data &&
          data.map((item, i) => (
            <div class="cards" key={i}>
              
            </div>
          ))}
      </div>
  );
};

export default Home;
